$scope.CHEM103BiomedicalOptionListener = function () {
var currentTime = new Date().getTime();
if (currentTime - CHEM103BiomedicalOptionTime <= 200) { 
        CHEM103BiomedicalOptionTime = currentTime;
        return;
    }
CHEM103BiomedicalOptionTime = currentTime;
  var CHEM103BiomedicalOptionelement = document.getElementById("CHEM103BiomedicalOption");
 if (!CHEM103BiomedicalOptionflag) {
     if (that.BiomedicalOptionClickedMap.get("CHEM103BiomedicalOption").length > 0) { 
 var trueCounter = 0;
          for (let i = 0; i < that.BiomedicalOptionClickedMap.get("CHEM103BiomedicalOption").length; i++) { 
        var cate = that.BiomedicalOptionClickedMap.get("CHEM103BiomedicalOption")[i];
        if (CHEM103BiomedicalOptionelement.classList.contains(cate + "-highlighted")) {
            trueCounter++;
            that.unHighlightElement(CHEM103BiomedicalOptionelement, cate);
        }
    }
    if (trueCounter > 0) {
        return;
    }}
      that.addLine(getLine70());
     that.highlightElement(CHEM103BiomedicalOptionelement, "NaturalSciences");
     that.addToClicked("CHEM103BiomedicalOption", "NaturalSciences");
      CHEM103BiomedicalOptionflag=true
  }
 else {
      that.removeLine(getLine70());
     that.unHighlightElement(CHEM103BiomedicalOptionelement, "NaturalSciences");
     var category = that.removeFromClicked("CHEM103BiomedicalOption", "NaturalSciences");
  if (category != "") { 
     that.highlightElement(CHEM103BiomedicalOptionelement, category);
}
      CHEM103BiomedicalOptionflag=false
  }
};
